  ///  Exercise Description Strings
  'ex_desc_1': "Mettiti sul pavimento con le braccia estese\ndritto sul lato all'altezza della spalla.\n\nSposta le braccia in senso orario in grandi cerchi velocemente.\n\nprova a farlo il più velocemente possibile.\n\nè un ottimo esercizio per il muscolo deltoide.",
  'ex_desc_2': "Inizia con i piedi insieme e le braccia ai lati, quindi saltati con i piedi e le mani sopra la testa.\n\ntorna alla posizione di avvio, quindi esegui il ripetitore successivo.\n\nQuesto esercizio fornisce un allenamento per tutto il corpo e funziona a tutti i gruppi muscolari larg.",
  'ex_desc_3': "Stai in piedi con i piedi insieme e le braccia ai lati.\n\nun passo da un piede di lato, alza le braccia e porta le mani in alto.\n\nrestituisce, cambi i lati e ripeti l'esercizio.",
  'ex_desc_4': "Stai in piedi con la larghezza della spalla dei piedi e l'arma si allunga in avanti, quindi abbassa il corpo fino a quando le cosce sono parallele al pavimento.\n\nle ginocchia dovrebbero essere estese nella stessa direzione delle dita dei piedi.\n\ntorna alla posizione di avvio e fai il prossimo rappresentante.\n\nFunziona le cosce, i glutei dei fianchi, i quadricipiti, i muscoli posteriori della coscia e la parte inferiore del corpo.",
  'ex_desc_5': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nquindi solleva la gamba destra e stringi il sedere il più possibile.\n\ntorna alla posizione iniziale e ripeti l'esercizio.",
  'ex_desc_6': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nquindi solleva la gamba sinistra e stringi il sedere il più possibile.\n\ntorna alla posizione iniziale e ripeti l'esercizio.",
  'ex_desc_7': "Sdraiati sulla schiena con le ginocchia piegate e i piedi piatti sul pavimento.\n\nmetti le braccia ai lati.\n\nquindi solleva il sedere su e giù.",
  'ex_desc_8': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani direttamente sotto le spalle.\n\nQuindi fai un respiro e fa cadere la pancia, le spalle rotolano indietro e la testa si alza verso il soffitto.\n\nmentre espiri, curva la schiena verso l'alto e lascia che la testa scenda.\n\nripeti l'esercizio.\n\nfallo lentamente con ogni fase di questo esercizio.",
  'ex_desc_9': "Stai a distanza con la larghezza della spalla dei piedi.\n\nPorta il ginocchio al gomito opposto.\n\ntorna alla posizione di avvio e ripeti con l'altro lato.",
  'ex_desc_10': "Stai a diversi metri di distanza da una panchina. Riposa il piede sinistro sulla panchina dietro di te.\n\nAbbassa il corpo fino a quando il ginocchio posteriore non tocca quasi il pavimento e la coscia anteriore è parallela al pavimento.\n\nQuindi torna alla posizione di avvio e ripeti l'esercizio.\n\ndovrebbe esserci abbastanza spazio tra il piede anteriore e la panca in modo che il ginocchio anteriore non vada sopra le dita dei piedi. Mantieni la parte superiore del corpo dritto.\n\nè un grande esercizio per il gluteo e i muscoli posteriori della coscia.",
  'ex_desc_11': "Stai a diversi metri di distanza da una panchina. Riposa il piede destro sulla panchina dietro di te.\n\nAbbassa il corpo fino a quando il ginocchio posteriore non tocca quasi il pavimento e la coscia anteriore è parallela al pavimento.\n\nQuindi torna alla posizione di avvio e ripeti l'esercizio.\n\ndovrebbe esserci abbastanza spazio tra il piede anteriore e la panca in modo che il ginocchio anteriore non vada sopra le dita dei piedi. Mantieni la parte superiore del corpo dritto.\n\nè un grande esercizio per il gluteo e i muscoli posteriori della coscia.",
  'ex_desc_12': "Stai in avanti con una delle gambe e le ginocchia piegate leggermente. Piega i gomiti e stringi i pugni davanti al viso.\n\nestendi un braccio in avanti con il palmo rivolto verso il pavimento. Prendi il braccio indietro e ripeti con l'altro braccio.",
  'ex_desc_13': "Inizia nella posizione della tavola del braccio dritto. Quindi\nsolleva alternativamente e abbassa entrambe le gambe su e giù. \n",
  'ex_desc_14': "Sdraiati sullo stomaco e piega i gomiti con le mani sotto le spalle.\n\nquindi spingi il petto da terra il più possibile. Torna alla posizione di avvio e ripeti.",
  'ex_desc_15': "Mettiti con la mano destra sollevata in alto e la mano sinistra in vita.\nPorta il gomito destro e il ginocchio destro per incontrarsi. Allungarsi e ripetere.",
  'ex_desc_16': "Mettiti con la mano sinistra sollevata in alto e la mano destra sulla vita.\n\nPorta il gomito sinistro e il ginocchio sinistro per incontrarsi. Allungarsi e ripetere.",
  'ex_desc_17': "Sdraiati sulla schiena con le ginocchia su un angolo di 90 gradi e le mani dietro la testa.\n\nsolleva la parte superiore del corpo e le cosce, quindi allungarsi.\n\nripeti questo esercizio.",
  'ex_desc_18': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani direttamente sotto le spalle.\n\npiega i gomiti e fai un push-up. Torna alla posizione di avvio e ripeti.",
  'ex_desc_19': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nquindi solleva la gamba destra di lato con un angolo di 90 gradi.",
  'ex_desc_20': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nquindi solleva la gamba sinistra sul lato ad un angolo di 90 gradi.",
  'ex_desc_21': "Sdraiati su un fianco con la testa poggiata sul braccio destro.\n\nSolleva la parte superiore della gamba e torna alla posizione di avvio.\n\nAssicurati che la gamba destra vada dritto su e giù durante l'esercizio.\n\nè un ottimo esercizio per il gluteo.",
  'ex_desc_22': "Sdraiati su un fianco con la testa poggiata sul braccio destro.\n\nSolleva la parte superiore della gamba e torna alla posizione di avvio.\n\nAssicurati che la gamba sinistra vada dritto su e giù durante l'esercizio.\n\nè un ottimo esercizio per il gluteo.",
  'ex_desc_23': "Sdraiati sul pavimento con le mani dietro le orecchie.\n\nAlza le ginocchia e chiudi il gomito destro verso il ginocchio sinistro, quindi chiudi il gomito sinistro verso il ginocchio destro.\n\nripeti l'esercizio.",
  'ex_desc_24': "Stai in piedi con la larghezza della spalla dei piedi e le mani sui fianchi.\n\nFai un passo avanti con la gamba destra e abbassa il corpo fino a quando la coscia destra è parallela al pavimento.\n\nrestituisci e passa all'altra gamba.\n\nQuesto esercizio rafforza il quadricipite, il gluteo maximus e i muscoli posteriori della coscia.",
  'ex_desc_25': "Mettiti con le mani sui fianchi e sui piedi un po 'più larghi della larghezza della spalla.\n\nquindi abbassa il corpo fino a quando le cosce sono parallele al pavimento.\n\nLe tue ginocchia dovrebbero essere estese nella stessa direzione del tuo appuntamento.",
  'ex_desc_26': "Sdraiati sulla schiena con i piedi piatti sul pavimento. Metti la caviglia destra sul ginocchio sinistro.\n\nSolleva il ginocchio sinistro e prendi la parte posteriore di\nla coscia sinistra con entrambe le mani. Tiralo delicatamente verso il tuo corpo.",
  'ex_desc_27': "Sdraiati sulla schiena con i piedi piatti sul pavimento. Metti la caviglia sinistra sul ginocchio destro.\n\nSolleva il ginocchio destro e prendi la parte posteriore di\nla coscia destra con entrambe le mani. Delicatamente\ntiralo verso il tuo corpo.",
  'ex_desc_28': "Inizia nella posizione di push-up.\n\npiega il ginocchio destro verso il petto e mantieni la gamba sinistra dritta, quindi passa rapidamente da una gamba all'altra.\n\nquesto esercizio rafforza più gruppi muscolari.",
  'ex_desc_29': "Sdraiati sulla schiena con le braccia ai lati.\n\nsolleva le gambe e mantienile il più dritto possibile.\n\nquindi solleva rapidamente la gamba destra e simultaneo abbassa la gamba sinistra.\n\nswitch gambe e ripeti.",
  'ex_desc_30': "Stai a distanza con i piedi e le mani appoggiate sui fianchi.\n\nQuindi piega la gamba sinistra e piega il corpo sul lato sinistro.\n\ntieni la posizione per alcuni secondi, quindi ritorna e ripeti con l'altro lato.",
  'ex_desc_31': "Stai dritto.\n\nQuindi fai un passo indietro con la gamba sinistra a destra e piega le ginocchia allo stesso tempo.\n\ntorna alla posizione di avvio e passa dall'altra parte.",
  'ex_desc_32': "Stai dritto.\n\nQuindi fai un passo indietro la gamba destra e abbassa il corpo.\n\nQuando vieni, alza il ginocchio destro il più alto possibile.\n\ntorna alla posizione di partenza e ripeti l'esercizio.",
  'ex_desc_33': "Stai dritto.\n\nQuindi fai un passo indietro nella gamba sinistra e abbassa il corpo.\n\nQuando vieni, alza il ginocchio sinistro il più alto possibile.\n\ntorna alla posizione di partenza e ripeti l'esercizio.",
  'ex_desc_34': "Fai un grande passo avanti con la gamba destra e mantieni la parte superiore del corpo dritto.\n\nQuindi fai andare il tuo corpo dritto verso il basso e su.",
  'ex_desc_35': "Fai un grande passo avanti con la gamba sinistra e mantieni la parte superiore del corpo dritto.\n\nQuindi fai andare il tuo corpo dritto verso il basso e su.",
  'ex_desc_36': "Stai dritto con i piedi insieme.\n\nSposta la gamba destra di lato, quindi abbassa il corpo mantenendo la gamba sinistra dritta.\n\ntorna alla posizione di avvio e passa dall'altra parte.",
  'ex_desc_37': "Sdraiati e piega le ginocchia con i piedi piatti sul pavimento. Attraversa le braccia davanti al petto.\n\nquindi solleva la testa e le spalle per fare un angolo di 30 gradi con il terreno.\n\nfunziona principalmente sul muscolo e obliqui addominis retto.",
  'ex_desc_38': "Sdraiati sulla schiena con le ginocchia su un angolo di 90\ngradi e le braccia si sono sollevate verso il soffitto.\n\nAbbassa la gamba destra ed estendi il braccio sinistro\nsopra la testa.\n\ntienilo per un secondo, quindi torna alla posizione start\ne ripeti con l'altro lato.",
  'ex_desc_39': "Sdraiati sulla schiena e metti le mani sotto i fianchi per il supporto.\n\nquindi solleva le gambe fino a quando non sono da un angolo retto con il pavimento.\n\nriporta lentamente le gambe e ripeti l'esercizio.",
  'ex_desc_40': "Sdraiati sulla schiena con le gambe estese e i gomiti direttamente sotto le spalle.\n\nSolleva la gamba sinistra con un angolo di 45 gradi mentre raggiungi il braccio destro sul lato sinistro.\n\ntorna lentamente alla posizione di partenza.\n\nRipeti più volte, quindi passa dall'altra parte.",
  'ex_desc_41': "Sdraiati sul pavimento con le dita dei piedi e gli avambracci per terra.\n\nMantieni il corpo dritto e mantieni questa posizione il più a lungo possibile.\n\nquesto esercizio rafforza l'addome, indietro e spalle.",
  'ex_desc_42': "Sdraiati sulla schiena con le braccia ai lati e le spalle leggermente sollevate.\n\nSolleva le gambe dal pavimento, piega le ginocchia e tirale verso il petto.\n\ncalcia i piedi in avanti e ripetilo.",
  'ex_desc_43': "Alzati sul pavimento, quindi corri in posizione mentre ti alzi il tallone per toccare il sedere ad ogni passo.\n\nprova a farlo il più velocemente possibile.\n\nè un ottimo esercizio per il gluteo e i danni.",
  'ex_desc_44': "Sdraiati sul lato sinistro con il piede sinistro dietro il piede destro.\n\nMetti la mano destra dietro la testa e la mano sinistra sul lato destro dei muscoli obliqui.\n\nsolleva la spalla sinistra dal pavimento.\n\nripeti l'esercizio.",
  'ex_desc_45': "Sdraiati sul lato destro con il piede destro dietro il piede sinistro.\n\nMetti la mano sinistra dietro la testa e la mano destra sul lato sinistro dei muscoli obliqui.\n\nsolleva la spalla destra dal pavimento.\n\nripeti l'esercizio.",
  'ex_desc_46': "Sdraiati a terra con le gambe piegate e le braccia ai lati.\n\nSolleva leggermente la parte superiore del pavimento e fai raggiungere le mani alternativamente.",
  'ex_desc_47': "Siediti sul pavimento con le ginocchia piegate, i piedi sollevati un po 'e indietro intitolati all'indietro.\n\nsolleva alternativamente le gambe e batti sotto le ginocchia.",
  'ex_desc_48': "Sdraiati sullo stomaco con le braccia estese\ndritte sopra la testa. Quindi alza entrambe le braccia e le gambe dal pavimento.\n\ntieni questa posizione per due secondi. Torna alla posizione di avvio\ne ripeti.",
  'ex_desc_49': "Sdraiati sulla schiena con le gambe allungate e le mani sotto i fianchi.\n\nSolleva le ginocchia fino a quando le cosce sono perpendicolari al pavimento. Raddrizza le gambe e solleva i fianchi dal pavimento.\n\ntorna alla posizione iniziale e ripeti\nl'esercizio. \n",
  'ex_desc_50': "Inizia con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nquindi allunga la gamba destra e il braccio sinistro allo stesso tempo.\n\ntieni per cinque secondi, quindi torna indietro e ripeti con l'altro.",
  'ex_desc_51': "Sdraiati sul lato sinistro con l'avambraccio che sostiene la parte superiore del corpo e la mano destra a terra di fronte a te.\n\nTieni insieme entrambe le gambe. Solleva leggermente le gambe e tieni premuto per un secondo, quindi torna alla posizione di avvio\n. Ripeti l'esercizio.",
  'ex_desc_52': "Sdraiati sul lato destro con l'avambraccio che sostiene la parte superiore del corpo e la mano sinistra a terra di fronte a te.\n\nTieni insieme entrambe le gambe. Solleva leggermente le gambe e tieni premuto per un secondo, quindi torna alla posizione di avvio\n. Ripeti l'esercizio. \n",
  'ex_desc_53': "Siediti sul pavimento con le ginocchia piegate, i piedi sollevati un po 'e indietro intitolati all'indietro.\n\nquindi tieni insieme le mani e torci da un lato all'altro.",
  'ex_desc_54': "Inizia nella normale posizione di push-up ma con le mani elevate su una sedia o una panchina.\n\nquindi spingi il corpo verso il basso usando la forza del braccio. Ricorda di mantenere il tuo corpo dritto.",
  'ex_desc_55': "Stai dritto. Quindi fai un passo indietro con la gamba sinistra e abbassa il corpo. Quando vieni, calcia la gamba sinistra verso l'alto.\n\ntorna alla posizione di partenza e ripeti l'esercizio.",
  'ex_desc_56': "Stai dritto. Quindi fai un passo indietro con la gamba destra e abbassa il corpo. Quando vieni, calcia la gamba destra verso l'alto.\n\ntorna alla posizione di partenza e ripeti l'esercizio.",
  'ex_desc_57': "Per la posizione di partenza, siediti sulla sedia. Quindi spostati\nal fianco dalla sedia con le mani che tiene il bordo della sedia.\n\npiega lentamente e allunga le braccia per far salire il tuo corpo su e giù. Questo è un ottimo esercizio per i tricipiti.",
  'ex_desc_58': "Mettiti con i piedi un po 'più larghi della spalla di larghezza, i gomiti si piegano, i palmi rivolti con ogni altra e le dita puntate verso il soffitto.\n\nAbbassa il corpo fino a quando le cosce sono parallele al pavimento. Quando vieni, gira il corpo in sinistra, raddrizza la gamba destra, solleva il tallone destro e allunga e raggiungi il braccio destro verso la sinistra.\n\ntorna alla posizione di avvio e ripeti con l'altro lato.",
  'ex_desc_59': "Sdraiati sulla schiena con le ginocchia piegate e le braccia si sono allungate in avanti.\n\nquindi solleva la parte superiore del corpo dal pavimento.\n\ntieni per alcuni secondi e torna lentamente.\n\nlavora principalmente il muscolo addominio del retto e gli obliqui.",
  'ex_desc_60': "Sdraiati sul lato sinistro con la testa appoggiata sul braccio sinistro e sulle gambe estese.\n\nSolleva e piega il ginocchio destro davanti a te, quindi calcia la gamba. Ripeti l'esercizio.",
  'ex_desc_61': "Sdraiati sul lato destro con la testa appoggiata sul braccio destro e sulle gambe estese.\n\nSolleva e piega il ginocchio sinistro davanti a te, quindi calcia la gamba. Ripeti l'esercizio.",
  'ex_desc_62': "Sdraiati sullo stomaco e piega i gomiti con le mani sotto le spalle.\n\nquindi spingi il petto da terra il più possibile.\n\ntieni questa posizione per secondi.",
  'ex_desc_63': "Stai a distanza con la larghezza della spalla dei piedi. Piega le braccia davanti a te per mantenere l'equilibrio.\n\nAbbassa il corpo fino a quando le cosce sono parallele a\nsul pavimento. Vieni a metà verso l'alto invece di arrivare in tutto, poi accovacciati di nuovo. Ripetere.",
  'ex_desc_64': "Sdraiati sulla schiena con la gamba destra\ndritto a terra e la gamba sinistra si piega con il piede sinistro a terra.\n\nstringere la gamba destra e sollevarla verso l'alto fino a quando le cosce sono parallele, quindi abbassano lentamente\ndown.",
  'ex_desc_65': "Sdraiati sulla schiena con la gamba sinistra\ndritto a terra e la gamba destra si piegava con il piede destro piatto a terra.\n\nstringere la gamba sinistra e sollevarla verso l'alto fino a quando le cosce sono parallele, quindi abbassano lentamente\ndown.",
  'ex_desc_66': "Mettiti con la larghezza della spalla dei piedi. Metti le braccia davanti al petto per mantenere il tuo equilibrio.\n\nquindi fai uno squat e quando vieni, calcia la gamba sinistra di lato. Ripeti l'esercizio fisico e quindi passa alla gamba destra.\n\nInspira quando scendi ed espira quando si alza. Le ginocchia dovrebbero essere estese in linea con le dita dei piedi.\n\nè un ottimo esercizio per i quadricipiti e\ngluteus maximus.",
  'ex_desc_67': "Sdraiati sulla schiena con le braccia ai lati, le palme e le gambe estese.\n\nSolleva le gambe e attraversa la coscia destra su\na sinistra, quindi invertire l'esercizio.\n\nAssicurati che la schiena sia sempre piatta.\n\nè un grande esercizio per gli obliqui e\nrectus addominis.",
  'ex_desc_68': "Sdraiati sulla schiena con le ginocchia piegate e i piedi piatti sul pavimento.\n\nquindi solleva una gamba mentre si alza i fianchi dal pavimento il più alto possibile.\n\ntorna alla posizione iniziale e ripeti con l'altro lato.",
  'ex_desc_69': "Sdraiati sulla schiena con le ginocchia piegate e i piedi piatti sul pavimento.\n\nquindi solleva una gamba mentre si alza i fianchi dal pavimento il più alto possibile.\n\ntorna alla posizione iniziale e ripeti con l'altro lato.",
  'ex_desc_70': "Inizia in una posizione della tavola di braccio dritto con le mani sotto le spalle.\n\ncammina le mani e i piedi a sinistra contemporaneamente. Fai qualche passaggio a sinistra, quindi alcuni passaggi a destra. Ripeti l'esercizio.",
  'ex_desc_71': "Inizia con la larghezza della spalla dei piedi.\n\npiega il corpo e cammina le mani davanti a te il più possibile, quindi cammina indietro.\n\nripeti l'esercizio.",
  'ex_desc_72': "Inizia con la larghezza della spalla dei piedi. Piega leggermente le gambe e inclina il corpo superiore.\n\nmetti le mani davanti a te per mantenere il bilanciamento, quindi corri rapidamente.",
  'ex_desc_73': "Inizia in una posizione tozza con le mani toccando i piedi.\n\nsalta su, spalma le gambe e alza le braccia sopra la testa. Torna alla posizione di avvio e fai il prossimo rappresentante.",
  'ex_desc_74': "Inizia con la posizione della tavola.\n\nPorta un ginocchio e il gomito opposto per toccarli, quindi riportarli indietro.\n\nRipeti con l'altro lato.",
  'ex_desc_75': "Inizia nella posizione della tavola del braccio dritto con le mani sotto le spalle e i piedi\ninsieme.\n\nsalta i piedi e atterra sulle dita dei piedi, poi salta indietro. Ripeti l'esercizio.",
  'ex_desc_76': "Mettiti a distanza con la larghezza della spalla dei piedi, quindi metti le mani a terra e calcia i piedi all'indietro.\n\nFai un rapido push-up e salta su.",
  'ex_desc_77': "Stai in piedi con la larghezza della spalla dei piedi e le mani sui fianchi.\n\nFai un grande all'indietro con la gamba destra e abbassa il corpo fino a quando la coscia sinistra è parallela al pavimento.\n\nritorna e ripeti con l'altro lato.",
  'ex_desc_78': "Inizia nella posizione della tavola. Sposta il tuo corpo\navanti e indietro.",
  'ex_desc_79': "Mettiti sul pavimento, metti le mani davanti a te e salta da un lato all'altro.",
  'ex_desc_80': "Inizia con i piedi insieme e le mani sollevate sopra la testa.\n\nsalta su, spalma i piedi, abbassa le mani e accovacciati.\n\ntorna alla posizione di avvio e fai il prossimo rappresentante.",
  'ex_desc_81': "Inizia con le mani sotto le spalle, la gamba sinistra si piega e accanto all'esterno del braccio sinistro e la gamba destra si estendeva dietro di te. Quindi saltare e cambiare le gambe in aria.",
  'ex_desc_82': "Posiziona le braccia ai lati e fingi di tenere una maniglia di corda di salto in ogni mano.\n\nsalta e atterra alternativamente sulle palline dei piedi, ruotando i polsi contemporaneamente come se stessi girando una corda.",
  'ex_desc_83': "Inizia in posizione tozza, quindi salta su usando i muscoli addominali per la forza.\n\nquesto esercizio funziona l'addome.",
  'ex_desc_84': "Sdraiati a terra con le braccia che supportano il tuo corpo. Salta in avanti, porta le ginocchia\nverso il petto, quindi salta indietro nella posizione iniziale. Ripeti l'esercizio.",
  'ex_desc_85': "Inizia nella posizione della tavola del braccio dritto. Quindi piega il braccio destro e posiziona l'avambraccio a terra con il gomito sotto la spalla, quindi piega il braccio sinistro e vieni giù nella posizione tradizionale della tavola.\n\nquindi invertire e tornare alla posizione start\n. Ripeti l'esercizio.\n\nMantieni il corpo dritto durante l'esercizio.\nInspira quando scendi ed espiri quando ti vieni.\n\nè un ottimo esercizio per i quadricipiti, i tricipiti\ne i muscoli addominali.",
  'ex_desc_86': "Stai con la gamba sinistra a terra e la gamba destra dritta e sollevato sul lato destro.\n\nFai un piccolo salto e oscilla la gamba sinistra sul lato sinistro. Cambiare rapidamente le gambe e ripetere.",
  'ex_desc_87': "Inizia nella normale posizione di push-up, quindi lascia che le ginocchia tocchi il pavimento e sollevano i piedi dal pavimento.\n\nspingi il tuo corpo su e giù.",
  'ex_desc_88': "Corri in posizione tirando le ginocchia il più in alto possibile ad ogni passaggio.\n\nMantieni la parte superiore del corpo in posizione verticale durante questo esercizio.",
  'ex_desc_89': "Stai a distanza con la larghezza della spalla dei piedi.\n\nMetti le mani a terra e calcia i piedi all'indietro, quindi riporta i piedi e salta su.\n\nripeti l'esercizio.",
  'ex_desc_90': "Stai insieme con i piedi e le braccia ai lati.\n\nsalta su con i piedi di parte e le mani sopra la testa a forma di lettera \"x\".\n\nsalta indietro, metti le mani a terra, prendi a calci le gambe all'indietro e stendile.\n\ntorna alla posizione iniziale e ripeti.",
  'ex_desc_91': "Siediti su una sedia. Leggeria leggermente con i piedi sollevati dal pavimento. Solleva il ginocchio sinistro e portalo verso il gomito destro. Accendi e ripeti.",
  'ex_desc_92': "Siediti su una sedia e usa la mano destra per tenere il bordo della sedia.\n\ngira la testa sul lato anteriore sinistro e metti la mano sinistra sul lato destro della testa\n.\n\nquindi tirare delicatamente la testa verso il lato anteriore sinistro. Tienilo per alcuni secondi.",
  'ex_desc_93': "Siediti su una sedia e usa la mano sinistra per tenere il bordo della sedia.\n\ngira la testa sul lato anteriore destro e metti la mano destra sul lato sinistro della testa.\n\nquindi tirare delicatamente la testa verso il lato anteriore destro. Tienilo per alcuni secondi.",
  'ex_desc_94': "Stai a distanza con la larghezza della spalla dei piedi.\nMetti le mani sul muro per mantenere il bilanciamento.\n\ntorci le caviglie per fare il punto di punta\nverso l'esterno, quindi solleva i talloni su e giù.",
  'ex_desc_95': "Mettiti con la larghezza della spalla dei piedi a parte e le mani dietro le orecchie.\n\nSolleva il ginocchio destro e usa il gomito sinistro per toccare il ginocchio destro. Cambia i lati e ripeti.",
  'ex_desc_96': "Siediti su una sedia con la schiena dritta. Solleva lentamente il ginocchio sinistro verso l'alto, quindi abbassalo lentamente verso il basso.",
  'ex_desc_97': "Siediti su una sedia con la schiena dritta. Solleva lentamente il ginocchio destro verso l'alto, quindi abbassalo lentamente.",
  'ex_desc_98': "Inizia con la schiena contro il muro, quindi fai scorrere verso il basso fino a quando le ginocchia sono ad un angolo di 90 gradi.\n\nTieni la schiena contro il muro con le mani e le braccia lontano dalle gambe.\n\ntieni la posizione.\n\nL'esercizio è rafforzare i muscoli dei quadricipiti.",
  'ex_desc_99': "Siediti dritto sulla sedia con i piedi piatti sul pavimento.\n\nPrendi il bordo destro della sedia con la mano sinistra. Quindi raggiungi il braccio destro in alto e piega il corpo a sinistra.\n\ntieni questa posizione.",
  'ex_desc_100': "Mettiti in piedi o siediti con le braccia ai lati. Rollii le spalle verso le orecchie, quindi rotoli indietro e spremi, quindi rotoli giù. Ripeti l'esercizio.",
  'ex_desc_101': "Porta il mento sul petto e tienilo per alcuni secondi.\n\nquindi guarda lo sguardo verso il soffitto e lo tieni anche per alcuni secondi. Ripeti l'esercizio.",
  'ex_desc_102': "Mettiti in piedi e tieni una sedia con la mano destra per mantenere l'equilibrio.\n\nsolleva la gamba sinistra sul lato sinistro il più possibile. Tornare e ripetere.",
  'ex_desc_103': "Metti la mano destra sotto la tua coscia con il palmo. Mantieni la spalla destra\npiatta.\n\nMetti la mano sinistra sul lato destro della testa\n, quindi tira delicatamente la testa verso\na sinistra. Tienilo per alcuni secondi.",
  'ex_desc_104': "Metti la mano sinistra sotto la coscia con il palmo. Tieni la spalla sinistra\npiatta.\n\nMetti la mano destra sul lato sinistro della testa, quindi tira delicatamente la testa verso la destra. Tienilo per alcuni secondi.",
  'ex_desc_105': "Metti la mano destra sulla schiena, usa la mano sinistra per afferrare il gomito destro e tiralo delicatamente.\n\ntieni questa posizione per un secondo.",
  'ex_desc_106': "Metti la mano sinistra sulla schiena, usa la mano destra per afferrare il gomito sinistro e tiralo delicatamente.\n\ntieni questa posizione per un secondo.",
  'ex_desc_107': "Siediti dritto sulla sedia con i piedi piatti sul pavimento.\n\nPrendi il bordo sinistro della sedia con la mano destra. Quindi raggiungi il braccio sinistro in alto e piega il corpo a destra.\n\ntieni questa posizione.",
  'ex_desc_108': "Stai a distanza con la larghezza della spalla dei piedi.\n\nmetti la mano sinistra dietro la testa e la mano destra al fianco. Piega il tuo corpo al lato destro e abbassa la mano destra\nverso il pavimento.\n\npausa per un secondo e torna al\n",
  'ex_desc_109': "Stai davanti a un muro a un grande passo da esso.\n\nquindi metti le mani dritte verso il muro e appoggiati.\n\npiega lentamente i gomiti e premi la parte superiore del corpo verso il pozzo.\n\nspingi indietro e ripeti l'esercizio.\n\nricorda di mantenere il tuo corpo dritto.",
  'ex_desc_110': "Mettiti con i piedi di distanza 6-12 pollici. Allunga le braccia davanti a te.\n\nAbbassa il corpo fino a quando le cosce sono parallele al pavimento. Tornare alla posizione iniziale e ripetere l'esercizio.",
  'ex_desc_111': "Alzati dritti con i piedi di distanza con spalla. Metti le mani su entrambi i lati della vita, le dita rivolte verso il basso e i gomiti rivolti verso l'esterno.\n\ntirano delicatamente i gomiti all'indietro, quindi riportali alla posizione di partenza.\nRipeti l'esercizio.",
  'ex_desc_112': "Siediti su una sedia con la schiena dritta e i piedi piatti a terra.\n\nPrendi la parte posteriore della sedia, inspira profondamente e apri il petto e le spalle. Tenere per\npochi secondi",
  'ex_desc_113': "Siediti sul bordo di una sedia con la schiena dritta, estendi la gamba sinistra davanti a te con il tallone a terra, dita dei piedi rivolte verso l'alto.\n\nraggiungi entrambe le mani verso le dita dei piedi. Tenere questa posizione per alcuni secondi.",
  'ex_desc_114': "Siediti sul bordo di una sedia con la schiena dritta, estendi la gamba destra davanti a te con il tallone a terra, dita dei piedi rivolte verso l'alto.\n\nraggiungi entrambe le mani verso le dita dei piedi. Tenere questa posizione per alcuni secondi.",
  'ex_desc_115': "Stai a parte con i piedi la larghezza delle spalle.\nMetti le mani dietro di te e mettetele intrecciate. Quindi tira indietro i gomiti e estendi le braccia. Tienilo per qualche secondo.",
  'ex_desc_116': "Prepara una sedia che riguarda l'altezza delle ginocchia e mettila dietro di te.\n\nStai con la larghezza della spalla dei piedi e allunga le braccia dritto in avanti. Quindi abbassa il corpo e siediti lentamente sulla sedia.\n\nspremere i glutei e torna alla postura in piedi. Ripeti l'esercizio.",
  'ex_desc_117': "Mettiti in piedi e tieni una sedia con la mano sinistra per mantenere l'equilibrio.\n\nSolleva la gamba destra sul lato destro il più possibile. Tornare e ripetere.",
  'ex_desc_118': "Sdraiati sul lato sinistro con la testa appoggiata sulla mano sinistra.\n\nquindi solleva la gamba destra e ruota il piede in cerchio.",
  'ex_desc_119': "Sdraiati sul lato destro con la testa appoggiata sulla mano destra.\n\nquindi solleva la gamba sinistra e ruota il piede in cerchio.",
  'ex_desc_120': "Siediti e incrocia le gambe sul tappeto. Sollevare il braccio destro in alto e mettere la mano sinistra sul pavimento per il supporto.\n\nguarda la mano destra e piega lentamente il braccio sinistro; Nel frattempo, piega il corpo superiore a sinistra. Tienilo per alcuni secondi.",
  'ex_desc_121': "Siediti e incrocia le gambe sul tappeto. Sollevare il braccio sinistro in alto e mettere la mano destra sul pavimento per il supporto.\n\nguarda la mano sinistra e piega lentamente il braccio destro; Nel frattempo, piega il corpo superiore a destra. Tienilo per alcuni secondi.",
  'ex_desc_122': "Sdraiati sul lato sinistro con la testa appoggiata sul braccio sinistro e le ginocchia piegate.\n\nSolleva il ginocchio destro verso l'alto mantenendo toccando i tacchi, quindi torna alla posizione iniziale. Ripeti l'esercizio.",
  'ex_desc_123': "Sdraiati sul lato destro con la testa appoggiata sul braccio destro e le ginocchia piegate.\n\nSolleva il ginocchio sinistro verso l'alto mantenendo toccando i tacchi, quindi torna alla posizione iniziale. Ripeti l'esercizio.",
  'ex_desc_124': "Sdraiati sul lato destro con la testa appoggiata sulla mano destra.\n\nQuindi metti il piede sinistro in avanti sul pavimento.\n\nsolleva la gamba destra su e giù.",
  'ex_desc_125': "Sdraiati sul lato sinistro con la testa appoggiata sulla mano sinistra.\n\nQuindi metti il piede destro in avanti sul pavimento.\n\nsolleva la gamba sinistra su e giù.",
  'ex_desc_128': "Siediti sul pavimento, quindi appoggiati alla schiena e solleva le gambe dal pavimento. Dopo aver trovato una posizione di equilibrio, solleva la parte superiore del corpo e porta le ginocchia verso il petto. Quindi allungarsi e ripetere.\n\nEspira quando sollevi il corpo e inspiri quando ti allunga.\n\nè un grande esercizio per il muscolo addominale inferiore.",
  'ex_desc_129': "Sdraiati sul pavimento e solleva i fianchi dal pavimento mantenendo la schiena dritta.\n\ntieni questa posizione il più a lungo possibile.\n\nL'esercizio del ponte rafforza l'intero addome, la parte bassa della schiena e i glutei.",
  'ex_desc_130': "Sdraiati sulla schiena con i piedi piatti sul pavimento. Metti la caviglia destra sul ginocchio sinistro, la mano sinistra dietro l'orecchio e il braccio destro si estendono sul lato sul pavimento.\n\nSolleva le spalle dal pavimento, porta il gomito sinistro per incontrare il ginocchio destro e il braccio destro vicino al corpo, quindi torna lentamente. Ripeti l'esercizio.",
  'ex_desc_131': "Sdraiati sulla schiena con i piedi piatti sul pavimento. Metti la caviglia sinistra sul ginocchio destro, la mano destra dietro l'orecchio e il braccio sinistro si estendono sul lato sul pavimento.\n\nSolleva le spalle dal pavimento, porta il gomito destro per incontrare il ginocchio sinistro e il braccio sinistro vicino al corpo, quindi torna lentamente. Ripeti l'esercizio.",
  'ex_desc_132': "Sdraiati sullo stomaco con le gambe estese e il mento sulle braccia.\n\nsolleva le gambe dal pavimento, quindi solleva alternativamente le gambe sinistro e destro.",
  'ex_desc_133': "Siediti sul pavimento, solleva le gambe con un angolo di 45 gradi e appoggia la parte superiore del corpo con un angolo di 45 gradi.\n\nallunga le braccia in avanti.\n\ntieni questa posizione.",
  'ex_desc_134': "Sdraiati sullo stomaco con le ginocchia piegate e\ntalloni stringete insieme.\n\nquindi solleva i piedi su e giù. L'esercizio è molto efficace nel stringere il sedere.",
  'ex_desc_135': "Sdraiati sulla schiena con le ginocchia piegate, i piedi piatti a terra e le mani sotto i fianchi.\n\nsolleva le gambe in posizione da tavolo; Lascia cadere il piede sinistro verso terra. Tocca il terreno con le dita dei piedi; Quindi rialza la gamba. Cambia i lati e ripeti l'esercizio.",
  'ex_desc_136': "Sdraiati a faccia in giù sul pavimento con le braccia completamente estese e i pollici rivolti verso l'alto, il corpo dovrebbe essere a forma di lettera \"y\".\n\nsolleva le braccia da terra il più possibile e metterle in cima per 2 secondi. Torna lentamente indietro nella posizione di inizio e ripeti l'esercizio. \n",
  'ex_desc_137': "Siediti sul pavimento con i piedi insieme e afferra le dita dei piedi.\n\nApri le ginocchia ai lati e premi le ginocchia. Rimani in questa posizione.",
  'ex_desc_138': "Sdraiati sulla schiena con le gambe estese.\n\npiega le ginocchia e portale verso il petto; Abbraccia le ginocchia con entrambe le mani. Tenere per alcuni secondi.",
  'ex_desc_139': "Sdraiati sulla schiena con le ginocchia in alto con un angolo di 90\ngradi.\n\nestendi le braccia ai lati e metti i tuoi palmi a terra.\n\nruota le gambe a sinistra mantenendo la parte superiore del corpo in posizione e le ginocchia e i piedi\ninsieme.\n\ntienilo per un secondo, quindi ritorna e torni all'altro lato. Ripeti l'esercizio.",
  'ex_desc_140': "Inizia in una posizione di tavola standard.\n\nruota la colonna vertebrale sul lato sinistro fino a quando la gamba sinistra non tocca il pavimento, quindi si gira sull'altro lato.\n\nripeti l'esercizio.",
  'ex_desc_141': "Sdraiati sulla schiena con le mani allungate ai lati e alle gambe.\n\nsolleva le gambe e le braccia dal pavimento. Quindi alza la parte superiore del corpo e spremi le braccia e le ginocchia verso gli addominali.\n\nabbassa le braccia e le gambe (ma non toccare il pavimento) e ripetere l'esercizio.",
  'ex_desc_142': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani direttamente sotto le spalle.\n\nSolleva la gamba destra all'indietro, quindi abbassala al lato sinistro. Sollevalo di nuovo e abbassalo\ndritto verso il basso.\n\nper favore non lasciare che il piede destro tocchi il pavimento\n. Ripeti i passaggi.",
  'ex_desc_143': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani direttamente sotto le spalle.\n\nSolleva la gamba sinistra all'indietro, quindi abbassala al lato destro. Sollevalo di nuovo e abbassalo\ndritto verso il basso.\n\nper favore non lasciare che il piede sinistro tocchi il pavimento.\nRipeti i passaggi.",
  'ex_desc_145': "Tieni insieme gli avambracci all'altezza della spalla\ne piega i gomiti con le mani insieme per fare una forma.\n\nquindi solleva gli avambracci su e giù.",
  'ex_desc_146': "Sdraiati sullo stomaco con le gambe dritte e le braccia sollevate ed estese sopra la testa.\n\npiega i gomiti e tirali verso il basso sui lati. Torna alla posizione iniziale e ripeti.",
  'ex_desc_147': "Stai a distanza con la larghezza della spalla dei piedi. Tieni un manubrio in ogni mano ai lati.\n\nsolleva le braccia con il braccio sinistro davanti a te e il braccio destro sul lato destro.\n\ntorna alla posizione di partenza, cambia i bracci e ripeti.",
  'ex_desc_148': "Stai a distanza con la larghezza della spalla dei piedi. Avvolgiti, piega leggermente le ginocchia e siediti indietro. Tieni un manubrio in ogni mano.\n\npiega i gomiti e tirali all'indietro. Abbassa le mani e ripeti l'esercizio.",
  'ex_desc_149': "Sdraiati sulla schiena con le ginocchia piegate e i piedi piatti sul pavimento.\n\ntieni un manubrio in ogni mano e alza le braccia verso il soffitto con i palmi di fronte all'altro e i gomiti leggermente piegati.\n\nAbbassa i manubri ai lati fino a quando la parte superiore delle braccia non tocca il pavimento. Ritorna e ripeti l'esercizio.",
  'ex_desc_150': "Sdraiati sulla schiena con le gambe sollevate, le ginocchia piegate e i tacchi stretti insieme.\n\nmetti le braccia ai lati.\n\nraddrizza le gambe e riportarle alla posizione di partenza.\n\nripeti l'esercizio.",
  'ex_desc_151': "Sdraiati sulla schiena con le braccia ai lati. Solleva le gambe e mantenerle il più dritto possibile.\n\ndiffondi le gambe, quindi riportarle indietro.\nRipeti l'esercizio.",
  'ex_desc_152': "Sdraiati sulla schiena con le gambe piegate e sollevate. Esegui l'azione di ciclismo con le gambe più volte, quindi invertirla.",
  'ex_desc_153': "Inizia con le mani sotto le spalle, il ginocchio destro direttamente sotto il sedere e la gamba sinistra si estende e riposato a terra.\n\nsolleva la gamba sinistra sul lato sinistro. Torna alla posizione di avvio e ripeti l'esercizio.",
  'ex_desc_154': "Inizia con le mani sotto le spalle, il ginocchio sinistro direttamente sotto il sedere e la gamba destra si è allungata e riposato a terra.\n\nsolleva la gamba destra sul lato destro. Torna alla posizione di avvio e ripeti l'esercizio.",
  'ex_desc_155': "Metti un braccio sul corpo, parallelo a terra, quindi usa l'altro braccio per tirare il braccio parallelo verso il petto.\n\ntieni per un po ', cambia il braccio e ripeti l'esercizio.\n\nMantieni il braccio interno dritto durante l'esercizio.",
  'ex_desc_156': "Stai con la mano destra sul muro.\n\npiega la gamba sinistra e afferra la caviglia o le dita dei piedi per avvicinare il vitello sinistro alla coscia sinistra.\n\ntieni questa posizione.",
  'ex_desc_157': "Stai con la mano sinistra sul muro. Piega la gamba destra e afferra la caviglia o le dita dei piedi per avvicinare il vitello destro alla coscia destra. Rimani in questa posizione.",
  'ex_desc_158': "Mettiti un grande passo davanti a un muro.\n\nPassa in avanti con il piede sinistro e spingi il muro con le mani.\n\nAssicurati che la gamba destra sia completamente estesa e che tu possa sentire il tuo allungamento del vitello destro.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_159': "Mettiti un grande passo davanti a un muro.\n\nFai un passo avanti con il piede destro e spingi il muro con le mani.\n\nAssicurati che la gamba sinistra sia completamente estesa e puoi sentire lo stretching del vitello sinistro.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_160': "Inizia con le ginocchia e le mani sul pavimento.\n\nMetti le mani un po 'in avanti, allarga le ginocchia e metti insieme le dita dei piedi.\n\nfai un respiro, quindi espira e siediti.\n\nProva a far toccare il culo. Rilassati i gomiti, fai toccare la fronte e prova ad abbassare il petto vicino al pavimento.\n\ntieni questa posizione.\n\ntieni le braccia allungate in avanti mentre ti siedi.\n\nAssicurati che ci sia abbastanza spazio tra le spalle e le orecchie durante l'esercizio.",
  'ex_desc_161': "Sdraiati sul pavimento con i piedi insieme.\n\nApri le ginocchia ai lati.\n\ntieni questa posizione.",
  'ex_desc_162': "Sdraiati sulla schiena con le gambe dritte e le braccia allungate ai lati.\n\nsolleva le ginocchia e torci le gambe a destra.\n\ntieni questo esercizio.",
  'ex_desc_163': "Sdraiati sulla schiena con le gambe dritte e le braccia allungate ai lati.\n\nsolleva le ginocchia e torci le gambe a sinistra.\n\ntieni questo esercizio.",
  'ex_desc_164': "Inizia nella posizione della tavola del braccio dritto. Solleva il braccio destro e la gamba sinistra fino a quando non sono paralleli a terra. Torna alla posizione di avvio e ripeti con l'altro lato.",
  'ex_desc_165': "Stare di fronte a una sedia. Quindi fai un passo avanti sulla sedia\ne calpesta.\n\nL'esercizio funziona per rafforzare le gambe e i glutei.",
  'ex_desc_166': "Siediti su una panchina, metti le mani dietro di te e prendi la panchina, inclina il corpo all'indietro.\n\nsolleva le gambe, piega le ginocchia e porta le ginocchia verso il petto. Estendere completamente le gambe e ripetere.",
  'ex_desc_167': "Trova una porta, prendi una posizione di affondo nella porta\ncon le braccia sul telaio della porta\ne i gomiti un po 'più bassi delle spalle, quindi porta lentamente il petto in avanti.\n\ntieni questa posizione per 30-40 secondi. Quindi ne esci lentamente, prendi le braccia\ne fai un paio di rotoli di spalla.\n\nNon tirare la testa in avanti e tieni il tuo collo rilassato.",
  'ex_desc_168': "Sdraiati sulla schiena con le gambe estese. Solleva la gamba destra e usa la mano sinistra\nper tirare il ginocchio destro a sinistra, ma mantieni l'altro braccio esteso sul lato sul pavimento.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_169': "Sdraiati sulla schiena con le gambe estese.\n\nSolleva la gamba sinistra e usa la mano destra\nper tirare il ginocchio sinistro a destra, ma tieni l'altro braccio esteso sul lato sul pavimento.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_170': "Inizia in una posizione push-up.\n\nPorta il ginocchio sinistro in avanti e lascia cadere il ginocchio destro sul pavimento.\n\nalza la parte superiore del corpo e metti le mani sulla vita.\n\nquindi spingi i fianchi in avanti mantenendo la parte superiore del corpo.\n\nAssicurati che il ginocchio anteriore non passi le dita dei piedi.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_171': "Inizia in una posizione push-up.\n\nPorta il ginocchio destro in avanti e lascia cadere il ginocchio sinistro sul pavimento.\n\nalza la parte superiore del corpo e metti le mani sulla vita.\n\nquindi spingi i fianchi in avanti mantenendo la parte superiore del corpo.\n\nAssicurati che il ginocchio anteriore non passi le dita dei piedi.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_172': "Mettiti sul pavimento con le mani riposate sui fianchi e sulla larghezza della spalla dei piedi.\n\nSolleva la gamba sinistra a livello di vita e piega il ginocchio ad angolo retto.\n\nquindi ruota il corpo sul lato sinistro e ruota indietro. Cambia i lati e ripeti l'esercizio.\n\ntieni le dita dei piedi della gamba in piedi rivolta in avanti. Le ginocchia dovrebbero affrontare la stessa direzione delle dita dei piedi.",
  'ex_desc_173': "Mettiti sul pavimento, piega leggermente le gambe e inclina la parte superiore del corpo in avanti.\n\nquindi salta a destra. Mentre salti, porta il tuo piede sinistro dietro di te e il braccio sinistro davanti a te.\n\nquindi salta dall'altra parte. Ripeti l'esercizio.",
  'ex_desc_174': "Mettiti a distanza con i piedi con i tuoi piedi e metti il piede dominante leggermente in avanti.\nPiega leggermente le ginocchia, stringi i pugni e piega i gomiti a 90 gradi.\n\nSolleva il braccio destro all'altezza della spalla e mantieni l'avambraccio parallelo a terra. Ruota le spalle e i fianchi e colpisci verso sinistra.\nSwitch Sides e Ripeti.",
  'ex_desc_175': "Sdraiati a terra con le braccia che supportano il tuo corpo.\n\nMantieni il corpo dritto mentre alza e abbassa il corpo con le braccia.\n\nQuesto esercizio funziona al petto, alle spalle, ai tricipiti, alla schiena e alle gambe.",
  'ex_desc_176': "Inizia nella posizione di push-up. Quindi scendi per un push-up e man mano, ruota il corpo superiore e estendi il braccio destro verso l'alto.\n\nripeti l'esercizio con l'altro braccio. È un grande esercizio per il torace, le spalle, le braccia e il nucleo.",
  'ex_desc_177': "Sdraiati sul lato destro con l'avambraccio che sostiene il tuo corpo. Tieni il tuo corpo in una linea retta\n.\n\nQuesto esercizio si rivolge ai muscoli addominali e\nobliqui.",
  'ex_desc_178': "Sdraiati sul lato sinistro con l'avambraccio che sostiene il tuo corpo. Tieni il tuo corpo in linea retta.\n\nQuesto esercizio si rivolge ai muscoli addominali e\nobliqui.",
  'ex_desc_179': "Sdraiati sulla schiena con le ginocchia piegate e i piedi piatti sul pavimento. Metti le braccia dritti sopra la testa.\n\nsolleva la parte superiore del corpo dal pavimento, quindi lentamente torna alla posizione di inizio. L'esercizio\naumenta la resistenza addominale.",
  'ex_desc_180': "Stai in piedi con la larghezza della spalla dei piedi e\nle ginocchia leggermente piegate.\n\nsolleva le braccia davanti a te con i gomiti\npiegati.\n\nruota la parte superiore del corpo a sinistra e quindi\na destra.",
  'ex_desc_181': "Sdraiati sulla schiena con le gambe dritte e le mani ai lati.\n\nsolleva la gamba destra verso il soffitto. Tieni\nsul retro della tua coscia con le mani.\nMantieni questa posizione.",
  'ex_desc_182': "Sdraiati sulla schiena con le gambe dritte e le mani ai lati.\n\nsolleva la gamba sinistra verso il soffitto. Tieni\nsul retro della tua coscia con le mani.\nMantieni questa posizione.",
  'ex_desc_183': "Stai sul pavimento con le braccia estese\nai lati all'altezza della spalla.\n\nquindi piega il corpo e usa la tua mano sinistra per toccare il piede destro o avvicinarti al più possibile. Accendi i lati e ripeti.\n\nEspira quando pieni il tuo corpo e inspiri quando ti alzi.\n\ntieni le spalle e le gambe dritte durante l'esercizio.",
  'ex_desc_184': "Stai con le mani sulla vita. Sollevare la gamba sinistra e spostarla in senso orario nei cerchi grandi, quindi spostarla in senso antiorario.\ncommuta le gambe e ripeti l'esercizio.",
  'ex_desc_185': "Sdraiati sul lato sinistro con la testa appoggiata sul braccio sinistro.\n\npiega le ginocchia con un angolo di 90 gradi nella parte anteriore di te.\n\nraddrizza la gamba destra e sollevala dritta\nsu e giù.",
  'ex_desc_186': "Sdraiati sul lato destro con la testa appoggiata sul braccio destro.\n\npiega le ginocchia con un angolo di 90 gradi nella parte anteriore di te.\n\nraddrizza la gamba sinistra e sollevala dritta\nsu e giù.",
  'ex_desc_187': "Metti un cuscino sul fondo del muro. Sdraiati sulla schiena, solleva e metti le gambe sul muro.\n\nSposta i fianchi sul cuscino, il più vicino possibile al muro. Rimani in questa posizione.",
  'ex_desc_188': "Mettiti sul pavimento, quindi piega la gamba sinistra\ne afferra la caviglia o le dita dei piedi per avvicinare il vitello sinistro vicino alla coscia sinistra.\n\ntieni questa posizione per alcuni secondi, quindi cambia i lati e ripeti.\n\nil ginocchio sollevato dovrebbe sempre scendere dritti e la parte superiore del corpo dovrebbe mantenerlo dritto durante l'esercizio.",
  'ex_desc_190': "Sdraiati sul pavimento con le gambe estese.\n\nSolleva il ginocchio destro e prendilo con entrambe le mani.\n\ntira il ginocchio destro verso il petto il più possibile mantenendo la gamba sinistra dritta a terra.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_191': "Sdraiati sul pavimento con le gambe estese.\n\nSolleva il ginocchio sinistro e prendilo con entrambe le mani.\n\ntira il ginocchio sinistro verso il petto il più possibile mantenendo la gamba destra dritto a terra.\n\ntieni questa posizione per alcuni secondi.",
  'ex_desc_192': "Inizia con il ginocchio sinistro e le mani su una panchina, metti le mani direttamente sotto le spalle.\n\nQuindi rilassati la gamba destra fino a quando non è parallela\na terra. Torna alla posizione iniziale\ne ripeti l'esercizio.",
  'ex_desc_193': "Inizia con il ginocchio destro e le mani su una panchina, metti le mani direttamente sotto le spalle.\n\nQuindi calciare la gamba sinistra fino a quando non è parallela a\na terra. Tornare alla posizione iniziale e ripetere l'esercizio.",
  'ex_desc_194': "Siediti con le gambe estese di fronte a te.\nPiega la gamba sinistra con il piede sinistro vicino alla coscia destra.\n\nappoggia la parte superiore del corpo in avanti. Tenere questa posizione\n.",
  'ex_desc_195': "Siediti con le gambe estese di fronte a te.\nPiega la gamba destra con il piede destro\nvicino alla coscia sinistra.\n\nappoggia la parte superiore del corpo in avanti. Tenere questa posizione\n.",
  'ex_desc_196': "Stai insieme sul pavimento con i piedi.\n\nQuindi piega il tuo corpo e porta il tuo corpo superiore il più vicino possibile alle gambe.\n\ntieni questa posizione per alcuni secondi e ripeti.\n\nEspira quando pieni il tuo corpo e inspiri quando ti alzi. Tieni le gambe dritte durante l'esercizio.",
  'ex_desc_197': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani direttamente sotto le spalle.\n\nraddrizza le gambe e solleva i fianchi in una forma a testa in giù. Distribuisci i piedi\na parte e allarga le dita. Trasferisci il tuo peso alle gambe. Tenere questa posizione\n.",
  'ex_desc_198': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nPorta il ginocchio destro in avanti, posiziona il piede destro a terra tra la mano sinistra e il ginocchio sinistro e lascia cadere il ginocchio destro\nvicino al polso destro a terra.\n\nFai scorrere la gamba sinistra all'indietro. Metti gli avambracci a terra davanti alla tua gamba, con le dita a parte e le palme delle mani una di fronte all'altra. Tenere per alcuni secondi.",
  'ex_desc_199': "Inizia a quattro zampe con le ginocchia sotto il sedere e le mani sotto le spalle.\n\nPorta il ginocchio sinistro in avanti, posiziona il piede sinistro a terra tra il ginocchio destro e la mano destra e lascia cadere il ginocchio sinistro vicino al polso sinistro a terra.\n\nFai scorrere la gamba destra all'indietro. Metti gli avambracci a terra davanti alla tua gamba, con le dita a parte e le palme delle mani una di fronte all'altra. Tenere per alcuni secondi.",
  'ex_desc_200': "Alzati con le braccia ai lati. Attraversare la gamba sinistra dietro la gamba destra.\n\nestendi entrambe le braccia sopra la testa, afferra il palmo sinistro con la mano destra e tiralo sul lato destro. Piega la parte superiore del corpo al lato destro.\ntieni per alcuni secondi.",
  'ex_desc_201': "Alzati con le braccia ai lati. Attraversare la gamba destra dietro la gamba sinistra.\n\nestendi entrambe le braccia sopra la testa, afferra il tuo palmo destro con la mano sinistra e tiralo sul lato sinistro. Piega la parte superiore del corpo al lato sinistro.\ntieni per alcuni secondi.",
  'ex_desc_202': "Mettiti di fronte a un muro con i piedi a parte un po 'più largo della larghezza delle spalle e i fianchi contro il muro.\n\npiega le ginocchia per fare uno squat 1/4 e\n, quindi torna alla posizione di partenza. Ripeti l'esercizio.",
  'ex_desc_203': "Siediti su una sedia con la schiena dritta. Lentamente estendi la gamba destra fino a quando non è dritta e parallela a terra, quindi abbassarla lentamente verso il basso.\nRipeti l'esercizio.",
  'ex_desc_204': "Siediti su una sedia con la schiena dritta. Lentamente estendi la gamba sinistra fino a quando non è dritta e parallela a terra, quindi abbassarlo lentamente. Ripeti l'esercizio.",
  'ex_desc_205': "Sdraiati sul lato destro con le mani sul terreno per il supporto.\n\nposiziona un rullo di schiuma sotto il lato laterale della coscia destra e metti il piede sinistro in avanti sul pavimento. Rotola la coscia avanti e indietro dall'anca al ginocchio.",
  'ex_desc_206': "Sdraiati sul lato sinistro con le mani sul terreno per il supporto.\n\nPosiziona un rullo di schiuma sotto il lato laterale della coscia sinistra e metti il piede destro in avanti sul pavimento. Rotola la coscia e\nForth dal tuo fianco al ginocchio.",
  'ex_desc_207': "Stare incline a terra con avambracci che supportano a terra e le palme verso il basso.\n\nMetti un rullo di schiuma sotto le cosce e solleva i piedi da terra. Rotola i quadricipiti da\nal fianco in ginocchio avanti e indietro.",
  'ex_desc_208': "Siediti sul pavimento con le gambe estese di fronte a te. Metti un rullo di schiuma sotto le cosce, metti le mani dietro di te sul pavimento per il supporto.\n\nSolleva i piedi da terra e arrotola i muscoli posteriori della coscia dai fianchi alle ginocchia indietro\ne forti.",
  'ex_desc_209': "Siediti sul pavimento con le gambe estese di fronte a te. Metti un rullo di schiuma sotto le ginocchia, e metti le mani dietro di te sul pavimento per il supporto.\n\nSolleva lentamente il piede destro e raddrizza la gamba il più possibile. Quindi abbassarlo lentamente. Ripetere l'esercizio.",
  'ex_desc_210': "Siediti sul pavimento con le gambe estese di fronte a te. Metti un rullo di schiuma sotto le ginocchia, e metti le mani dietro di te sul pavimento per il supporto.\n\nSolleva lentamente il piede sinistro e raddrizza la gamba il più possibile. Quindi abbassarlo lentamente. Ripetere l'esercizio.",
  'ex_desc_211': "Sdraiati sulla schiena con le ginocchia piegate e i piedi\npiatti a terra.\n\nappiattire la parte bassa della schiena a terra per eliminare il divario tra la parte bassa della schiena e il pavimento, quindi tornare alla posizione di partenza.\n\nripeti l'esercizio.",
  'ex_desc_212': "Camminare piano. Metti il tallone a terra, rotola completamente attraverso il piede fino alle dita dei piedi, quindi spingi in avanti con le dita dei piedi.",
  'ex_desc_213': "Stai con le braccia contro un muro. Metti il piede destro sulla caviglia sinistra, quindi solleva il tallone sinistro su e giù.",
  'ex_desc_214': "Stai con le braccia contro un muro. Metti il piede sinistro sulla caviglia destra, quindi solleva il tallone destro e\n.",
  'ex_desc_215': "Inizia nella posizione di push-up, ma mantieni le braccia dritte. Questo esercizio rafforza il tuo addome e i muscoli della schiena.",
  'ex_desc_216': "Sdraiati sul lato sinistro. Metti il gomito sinistro direttamente sotto le spalle e metti la mano destra sulla vita. Metti la gamba destra\nsulla gamba sinistra.\n\nSolleva i fianchi verso l'alto, tieni premuto per 2-4\nsecondi, quindi torna alla posizione di avvio.\n\nripeti questo esercizio.",
  'ex_desc_217': "Sdraiati sul lato destro. Metti il gomito destro\ndirettamente sotto le spalle e metti la tua mano sinistra sulla vita. Metti la gamba sinistra sulla gamba destra.\n\nSolleva i fianchi verso l'alto, tieni premuto per 2-4\nsecondi, quindi torna alla posizione di avvio.\n\nripeti questo esercizio.",
  'ex_desc_218': "Inizia in una posizione tradizionale della tavola, quindi estendi alternativamente un braccio in avanti.\n\nMantieni il corpo dritto durante l'esercizio.\n\nè un grande esercizio per il muscolo muscolare e deltoide addominale.",
  'ex_desc_219': "Inizia in una posizione di tavola laterale destra, quindi solleva la parte superiore della gamba e preparala in avanti. Torna a\nla posizione di avvio e ripeti.\n\nNon ondeggiare i fianchi e mantenere le gambe e la parte superiore del corpo dritto durante l'esercizio.\n\nEspira quando la gamba fa uscire e inala\nquando la gamba torna.\n\nè un ottimo esercizio per il gluteo e il quadricipiti.",
  'ex_desc_220': "Inizia in una posizione della tavola laterale sinistra, quindi solleva la parte superiore della gamba e preparala in avanti. Torna a\nla posizione di avvio e ripeti.\n\nNon ondeggiare i fianchi e mantenere le gambe e la parte superiore del corpo dritto durante l'esercizio.\n\nEspira quando la gamba fa uscire e inala\nquando la gamba torna.\n\nè un ottimo esercizio per il gluteo e il quadricipiti.",
  'ex_desc_221': "Siediti sul pavimento con le gambe piegate, i fianchi su\ne le dita rivolte in avanti sotto le spalle.\n\ncalcia i piedi in aria alternando a sinistra e\na destra.",
  'ex_desc_222': "Sdraiati sulla schiena con le mani dietro le orecchie.\n\nquindi solleva la parte superiore del corpo e lentamente fino alla posizione seduta. Non tirarti il collo quando ti alzi.\n\ntorna lentamente alla posizione di partenza e ripeti l'esercizio.\n\nSe la colonna vertebrale fa male, si prega di passare a un altro allenamento.",
  'ex_desc_223': "Sdraiati sulla schiena con le mani ai lati e alle gambe direttamente verso il soffitto.\n\nSolleva i fianchi direttamente dal pavimento, quindi torna alla posizione di partenza.\n\nripeti l'esercizio.",
  'ex_desc_224': "Stai a distanza con la larghezza della spalla dei piedi.\n\nmetti le mani a terra e prendi i piedi all'indietro. Piega il ginocchio destro verso il petto e tieni la gamba sinistra dritta, quindi passa rapidamente alla gamba sinistra.\n\ncalcia il piede sinistro all'indietro, quindi salta su. Ripeti l'esercizio.",
  'ex_desc_225': "Inizia nella posizione sdraiata con le ginocchia piegate e i piedi leggermente di distanza.\n\nmetti le mani dietro le orecchie. Solleva la parte superiore del corpo e torci da un lato.\n\nabbassalo lentamente alla posizione di partenza. Ripeti con l'altro lato.",
  'ex_desc_226': "Sdraiati sulla schiena con le gambe dritte verso il soffitto e le mani ai lati.\n\npiù in basso una delle gambe. Quando lo sollevi, solleva i fianchi dal pavimento.\n\ntorna alla posizione iniziale. Passa all'altra gamba e ripeti l'esercizio.",
  'ex_desc_227': "Siediti con i palmi delle mani dietro i fianchi a terra ai lati.\n\nestendi le gambe e sollevale da terra. Sposta le gambe in senso antiorario in cerchio.",
  'ex_desc_228': "Stai sul pavimento con le braccia estese direttamente ai lati all'altezza della spalla.\n\nSposta le braccia in senso orario in cerchio velocemente.\n\nprova a farlo il più velocemente possibile.\n\nè un grande esercizio per il muscolo deltoide.",
  'ex_desc_229': "Sdraiati sul lato sinistro con l'avambraccio che sostiene il tuo corpo e le ginocchia piegate sul pavimento.\n\nmantieni la colonna vertebrale dritta. Rimani in questa posizione.",
  'ex_desc_230': "Sdraiati sul lato destro con l'avambraccio che sostiene il tuo corpo e le ginocchia piegate sul pavimento.\n\nmantieni la colonna vertebrale dritta. Rimani in questa posizione.",
  'ex_desc_231': "Mettiti sul pavimento con le braccia estese\ndritto sul lato all'altezza della spalla.\n\nSposta le braccia in senso antiorario in grandi cerchi\nvelocemente.\n\nprova a farlo il più velocemente possibile.\n\nè un ottimo esercizio per il muscolo deltoide.",
  'ex_desc_232': "Avvolgiti, piega le ginocchia e i gomiti.\n\nestendi le braccia dietro di te e spremi i tricipiti. Si prega di rendere le braccia parallele al terreno quando le estendi.\n\ntorna alla posizione iniziale e ripeti questo esercizio.",
  'ex_desc_233': "Siediti con le gambe piegate, metti le mani\nlarghezza delle spalle a terra dietro di te, e assicurati che le dita siano rivolte lateralmente.\n\nSolleva i fianchi fino a quando la parte superiore del corpo è parallela a terra e cammina in avanti con le mani e i piedi.",
  'ex_desc_234': "Stare in piedi con i piedi dovrebbe largo.\n\nallunga le braccia davanti a te all'altezza della spalla con un braccio sovrapposce l'altro a forma di lettera \"x\", quindi distribuiscile.\n\nSwitch Arms e ripeti l'esercizio.",
  'ex_desc_235': "Inizia nella posizione della tavola del braccio dritto.\nSolleva la mano destra per toccare la spalla sinistra.\n\ntorna alla posizione di avvio e ripeti con\nl'altra mano.",
  'ex_desc_236': "Stai con il braccio destro vicino a un muro. Estendi il braccio destro e metti la mano destra sul muro, quindi gira delicatamente il corpo a sinistra.",
  'ex_desc_237': "Stai con il braccio sinistro vicino a un muro. Allungano il braccio sinistro e metti la mano sinistra sul muro, quindi gira delicatamente il corpo in\na destra.",
  'ex_desc_238': "Stai sul pavimento con la larghezza delle spalle dei piedi. Estendi le braccia in avanti all'altezza della spalla con i palmi di fronte all'altro.\n\nestendi le braccia il più lontano possibile, quindi spostale sul davanti. Ripeti l'esercizio.",
  'ex_desc_239': "Tieni le mani insieme e sollevale in alto. Quindi muovi le braccia\nin senso antiorario in grandi cerchi.",
  'ex_desc_240': "Tieni le mani insieme e sollevale in alto. Quindi muovi le braccia in senso orario\nin grandi cerchi.",
  'ex_desc_241': "Stai davanti a un muro con le mani contro il muro. Fai un passo indietro e fai scorrere le mani giù fino a quando la parte superiore del corpo è parallela al pavimento.\n\nspingi le mani in avanti nel muro\nmentre tiri i fianchi dal muro. Trasferisci il tuo peso in piedi. Tenere\nquesta posizione.",
  'ex_desc_242': "Siediti con le ginocchia piegate e i piedi piatti sul pavimento.\n\nMetti le mani dietro di te sul pavimento e tieni le dita puntate all'indietro.\n\npiega leggermente i gomiti per sentire l'allungamento nella parte anteriore delle spalle.",
  'ex_desc_243': "Inizia nella posizione sdraiata con le gambe e le braccia ai lati.\n\nSolleva contemporaneamente la gamba sinistra e la parte superiore del corpo da terra e usa la mano destra per toccare le dita dei piedi. Ripeti con l'altra gamba.",
  'ex_desc_244': "Siediti con i palmi delle mani dietro i fianchi a terra ai lati.\n\nestendi le gambe e sollevale da terra. Sposta le gambe in senso orario in cerchio.",
  'ex_desc_245': "Siediti sul pavimento con le gambe piegate insieme e le mani sotto le spalle per sostenere il tuo corpo. Quindi solleva una gamba mentre si solleva i fianchi dal pavimento il più in alto possibile. Passa all'altra gamba e ripeti. Spingi te stesso con i fianchi invece con la schiena. È un ottimo esercizio per il gluteo.",
  'ex_desc_246': "Sdraiati sullo stomaco con le braccia estese dritto sopra la testa. Solleva alternativamente l'SRM e la gamba opposti.",
  'ex_desc_247': "Siediti e incrocia le gambe sul tappeto. Metti la mano sinistra sul ginocchio destro e la mano destra dietro di te sul pavimento.",
  'ex_desc_248': "Siediti e incrocia le gambe sul tappeto. Metti la mano destra sul ginocchio sinistro e la mano sinistra dietro di te sul pavimento. Dollegile lentamente la parte superiore del corpo a sinistra. Tienilo per alcuni secondi.",

